import { useSelector, useDispatch } from 'react-redux';
import { getNastavnici } from '../redux/actions';

function Nastavnici() {
  const nastavnici = useSelector((state) => state.nastavnici);
  const x = nastavnici.then((result) => {
    return result;
  });
  console.log(x);
  console.log(nastavnici);
  const dispatch = useDispatch();

  return (
    <div>
      <p>{nastavnici.ime}</p>;
      <button
        onClick={() => {
          dispatch(getNastavnici());
        }}
      >
        Svi nastavnici
      </button>
    </div>
  );
}

export default Nastavnici;
